import React from 'react';

function Footer() {
    return (
        <div style={phantom}>
        <footer style={footerStyle}>
            <a href="#">About</a>
        </footer>
         </div>
    )
}

const footerStyle = {
    backgroundColor: "#F8F8F8",
    borderTop: "1px solid #E7E7E7",
    textAlign: "center",
    padding: "20px",
    position: "fixed",
    left: "0",
    bottom: "0",
    height: "60px",
    width: "100%",
}

const phantom = {
    display: 'block',
    padding: '20px',
    height: '60px',
    width: '100%',
}

const linkStyle = {
}
export default Footer;
